import React,{useEffect} from "react";
import imageApi from "../../common/apis/imageApi";
import {APIKey} from "../../common/apis/imageApiKey";
import { useDispatch } from "react-redux";
import {addImages} from "../../features/Images/imageSlice";

const Tree = () => {
    const title="tree";
    const dispatch = useDispatch();
    useEffect(()=>{
        const fetchTitle = async () =>{
            const response =  await imageApi.get(`?key=${APIKey}&q=${title}&image_type=photo`)
            .catch((err) =>{
                console.log("Err :",err);
            });
            dispatch(addImages(response.data));
        };
        fetchTitle();
    },[]);
    return (
        <div>
            Hii
        </div>
    );
};

export default Tree;
